import React from "react";
import { Card, Image } from "semantic-ui-react";

const VideoItem = ({ video }) => {
	return (
		<div>
			<Card>
		    <Image className="ui image" src={video.snippet.thumbnails.high.url} wrapped ui={false} />
		    <Card.Content>
		      <Card.Header>{video.snippet.title}</Card.Header>
		      <Card.Meta>
		        <span className="channel">{video.snippet.channelTitle}</span>
						<br />
						<span className="date">{video.snippet.publishedAt}</span>
		      </Card.Meta>
		      <Card.Description>
		        {video.snippet.description}
		      </Card.Description>
		    </Card.Content>
		  </Card>
		</div>
	)
}

export default VideoItem;



